import React, { useState } from 'react';
import axios from 'axios';
import { Form, Button } from 'react-bootstrap';

function AddDoctor() {
  const [formData, setFormData] = useState({
    name: '',
    Specialization: '',
    email: '',
    timing: '',
    password: ''


  });

  const handleSubmit = async e => {
    e.preventDefault();
    try {
      const response = await axios.post('http://localhost:8081/api/admin/doctor', formData);
      console.log(response.data);

    } catch (error) {
      console.error(error);
    }
  };

  const handleChange = e => {
    const { name, value } = e.target;
    setFormData(prevState => ({ ...prevState, [name]: value }));
  };

  return (<div style={{ width: '50%', margin: '0 auto' }}>
    <Form onSubmit={handleSubmit}>
      <Form.Group className="mb-3" controlId="firstName">
        <Form.Label>First Name:</Form.Label>
        <Form.Control type="text" name="Name" value={formData.name} onChange={handleChange} />
      </Form.Group>

      <Form.Group controlId="lastName">
        <Form.Label>Last Name:</Form.Label>
        <Form.Control type="text" name="Specialization" value={formData.specialization} onChange={handleChange} />
      </Form.Group>

      <Form.Group controlId="email">
        <Form.Label>Email:</Form.Label>
        <Form.Control type="email" name="email" value={formData.email} onChange={handleChange} />
      </Form.Group>

      <Form.Group controlId="registrationDate">
        <Form.Label>Registration Date:</Form.Label>
        <Form.Control type="Timing" name="timing" value={formData.timing} onChange={handleChange} />
      </Form.Group>

      <Form.Group controlId="password">
        <Form.Label>Password:</Form.Label>
        <Form.Control type="password" name="password" value={formData.password} onChange={handleChange} />
      </Form.Group>


      <Button variant="primary" type="submit" >Add</Button>
    </Form></div>
  );
}

export default AddDoctor;
